window.bookSummaryJSON = "<p>Now infamous for his exploits, Jack Myst is a master thief. As a member of the Thieves Guild, he has fought assassins, reavers, and even a devil - but now he faces his greatest challenge yet, the rank of guildmaster. Ascending to the office after defeating Skorn at Margauth, he launches a daring plan, one to steal what cannot be stolen. </p> <p>A god. </p> <p>But Skorn has retrieved the fragments of an ancient artifact, and has begun construction on the Necrolith, the beacon of ending. He issues a king's bounty on Jack's head, turning governments and guilds against him. Hounded by soldiers and hunted by assassins, it will require all of Jack's skill to triumph over Skorn. </p> <p>He couldn't be more excited. </p>"; 
